class Column extends Component {

    constructor(props){
        super(props);

        state = {
            projects: [
                1,
                1
            ]
        }
    }

    addProjects() {
        this.state.projects = [1]
    }

    render(){
        return (
            <div className="column">
                <h1>sdads</h1>
                {this.state.projects.map(project => <Project/>)}
                <div>
                    <button onClick={this.addProjects}>Create</button>
                </div>
            </div>
        );
    }

}



export default Column
